import { HttpAuth } from '../../config/Http';
import itemsReducer from '../reducers/items.reducer';
import { useState } from 'react';

export function index () {
  const [state, setState] = useState();

  HttpAuth.get('/item')
    .then(
      response => setState(response.json())
    )
    .then( 
      console.log(state)
    )
}
